import React from 'react';

const BoardLinks = () => {
    return (
        <div className="board-links">
            <Link to="/board/1">1</Link>
            <Link to="/board/2">2</Link>
            <Link to="/board/3">3</Link>
            <Link to="/board/4">4</Link> 
        </div>
    );
};

export default BoardLinks;
